window.bookSummaryJSON = "<p>Damaged, Deceptive, Dangerous, Darling. </p> <p>When a group of teens wake up in the woods, these words are inked onto their skin. Are they labels? A warning? They must find the truth before a killer finds them. </p> <p>While on a mandatory senior field trip, a flash flood cuts off Sera and three classmates from their group with no way to call for help. But they're not as alone as they thought.... </p>"; 
